Triacle Life together with our sport smartwatch devices provides you with information that you need straight from your wrist. 

* It integrates with iOS Health App. 
* It has a built-in pedometer tracks your steps, distance, and calories burned;
* It has a built-in sleep monitor tracks your quality of sleep;
* It has a built-in heart rate sensor tracks your heart rate;

Our sport smartwatch is more than a traditional smartwatch. It is a powerful sport computer that monitors your sport performance in real time, and allows you to receive text message and notifications from your smartphone. 

Powered with multi-sport functionality, our sport smartwatch allows you to choose from a series of activity types such as running, biking, walking, hiking, trail run etc… 

In addition to its training functions, our sport smartwatch will also notify you when receiving incoming calls, text messages or social networks notifications.

The app will present your activity and other health info, for example, heart rate, calories of activity.
